import sys
sys.setrecursionlimit(10**7)


def solve1(inp, bomb):
    while bomb in inp:
        inp = inp.replace(bomb, "")

    if len(inp) == 0:
        return("FRULA") 
    else:
        return(inp)

def solve2(inp, bomb):
    bomblen = len(bomb)
    ret = [""]*len(inp)

    # -> nextpos
    def getsubstr(pos, bombpos):
        whereto = [pos]
        bombpos += 1
        pos += 1
        while bombpos < bomblen :
            if pos >= len(inp):
                for i, val in enumerate(whereto):
                    ret[val] = bomb[i]
                return pos
            elif inp[pos] == bomb[0]:
                pos = getsubstr(pos, 0)
            elif inp[pos] != bomb[bombpos]:
                for i, val in enumerate(whereto):
                    ret[val] = bomb[i]
                return pos
            else:
                whereto.append(pos)
                bombpos += 1
                pos += 1
        # bomb와 일치함
        return pos
        
    def solve():
        pos = 0
        while pos < len(inp):
            if inp[pos] != bomb[0]:
                ret[pos] = inp[pos]
                pos += 1
            else:
                pos = getsubstr(pos, 0)

    solve()
    ret = "".join(ret)

    if len(ret) == 0:
        return("FRULA")
    else:
        return(ret)

